(43, '2022-09-05 09:47:23', '333 IDPA 2/2022', 'สนาม 333 รังสิต', 'ประเภท รางวัล\r\nDIVISION - ESP / SSP / CDP / CCP - (MA, EX, UN คลาสละ 3รางวัล SS, MM, NV คลาสละ 5 รางวัล)\r\nREV / CO / BUG / PCC - (MA, EX, SS, MM, NV, UN คลาสละ 3รางวัล)\r\nDIVISION – SPD รายการรวมคลาส 5 รางวัล\r\nCATEGORIES - รายการละ5 รางวัล (SPD, PCCไม่สามารถร่วมชิงรางวัล)\r\n    LAW ENFORCEMENT / STATE ENTERPRISE /SENIOR / JUNIOR/ LADY / INTERNATIONAL\r\nDIVISION CHAMPION - รายการละ1 รางวัล (SPDไม่สามารถร่วมชิงรางวัล)\r\nESP / SSP / CDP / CCP / REV / CO / BUG / PCC\r\nMOST ACCURATE / OVERALL- รายการละ 1 รางวัล (SPD, PCCไม่สามารถร่วมชิงรางวัล)\r\nหมายเหตุ :\r\nรางวัลที่ 1 CATEGORIES, DIVISION CHAMPION, MOST ACCURATE , OVERALL รับถ้วยรางวัล  \r\nรางวัลที่ 1-5  DIVISION / CLASS รับเหรียญรางวัล\r\n  ‼️ทั้งนี้รางวัลอาจมีการเปลี่ยนแปลงตามความเหมาะสม คำตัดสินของคณะกรรมการจัดงานถือเป็นอันที่สิ้นสุด‼️\r\n  2022 Rule: M-5.5 A “Most Accurate” award is given to the competitor with the lowest points down and no HNT penalties.\r\nรางวัล “Most Accurate” ผู้จัด Tingly Army Club มอบให้กับนักกีฬาที่มี Points Down น้อยที่สุด และไม่ยิงประกัน โดยมีผลคะแนนติดอันดับครี่งหนึ่งจากจำนวนนักกีฬาทั้งหมด คำตัดสินของคณะกรรมการจัดงานถือเป็นอันที่สิ้นสุด', 'TIER 1', 10, 150, '2022-09-04', '2022-09-04', 'ติงลี่', '080 9991047', '37', NULL, NULL, '197736.jpg', NULL, NULL, NULL, 'enable', 'Umnarj ', '2022-09-20 09:03:26'),
